import React, { useEffect, useState } from "react";
import '../styles/table.css';


function Table() {
    const[elements,setElements] = useState([])

    useEffect(()=>{
     fetch("https://api.npoint.io/de68b6bf88b29ffe56f5")
     .then((response)=> response.json())
     .then((data)=>{
        setElements(data)
        console.log(data)
     })
    },[])

    let elementsList = elements.map((elem,index)=>{
        return(
            <div key={index} id="elementCard"></div>
        )
    })

    let lowerGrid = elements.filter()

    return ( 
      <div id="table">
        {elementsList}
      </div>
     );
}

export default Table;
